const findMaxAverage = function(nums, k) {
    let count = -10000000;
    for(let i=0;i<=nums.length-k;i++){
        if(nums.slice(i, k+i).reduce((a,b) => a+b)/k > count) count = nums.slice(i, k+i).reduce((a,b) => a+b)/k
    }
    return count;
};

